import logo from './logo.svg';
import './App.css';
import Header from './Components/Header'
import inputCity from './Components/InputCity';
function App() {
  return (
    <div className="App">
      <div><Header/></div>
      <div><inputCity/></div>
      <form><label>
    Name:
    <input type="text" name="name" />
  </label>
  <input type="submit" value="Submit" />
</form>

    </div>

  );
}

export default App;
